import { Breadcrumb, Layout, theme } from 'antd';
import React, { useState } from 'react';
import LeftMain from './LeftMain';
const { Content, Sider } = Layout;


const Mainpage = () => {
  const [leftMessage,setLeftMessage] = useState()
  const callBackLeftMessage = (obj) => {
    setLeftMessage(obj)
  }
  const {
    token: { colorBgContainer },
  } = theme.useToken();
  return (
      <Layout>
        <Sider
          width={200}
          style={{
            background: colorBgContainer,
          }}
        >
          {/* 左边栏 */}
          <LeftMain callBackLeftMessage={callBackLeftMessage}/>

        </Sider>
        <Layout
          style={{
            padding: '0 24px 24px',
          }}
        >
          {/* 该页面所在 */}
          <Breadcrumb
            style={{
              margin: '16px 0',
            }}
          >
            <Breadcrumb.Item>{leftMessage.length>0?leftMessage[1]:" "}</Breadcrumb.Item>
            <Breadcrumb.Item>{leftMessage.length>0?leftMessage[0]:" "}</Breadcrumb.Item>
          
          </Breadcrumb>
          {/* 具体情况 */}
          <Content
            style={{
              padding: 24,
              margin: 0,
              minHeight: 280,
              background: colorBgContainer,
            }}
          >
            Content
          </Content>
        </Layout>
      </Layout>
   
  );
};
export default Mainpage;
